import React from "react";
import Header from "./Header";
import ProductDetails from "./ProductDetails";
import ProductList from "./ProductList";
class App extends React.Component{

    render(){
    return(
        <div>
            <Header />
            <ProductDetails />
            <ProductList />
        </div>
    )
}
}

export default App;
